import React, { Component } from 'react';
import '../App.css';
import TodosList from "./TodosList"
import DoneList from "./DoneList"



class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="container">
          <div className="row">
            <TodosList></TodosList>
            <DoneList></DoneList>
          </div>
        </div>

      </div>
    );
  }
}


export default App;
